// SPDX-License-Identifier: MIT
pragma solidity 0.8.0;

import "./interfaces/AggregatorV2V3Interface.sol";
import "./utilities/ContractsListCL.sol";

contract OneClickOracle  {
    int256  private immutable exp_base = 10;
    int8    private immutable base_decimals = 18;    
    bool    private contract_paused = false;
    address private owner;

    //Mappings
    mapping(address => address) tokenPriceFeedMapping;
    //Events
    event priceFeedAdded(address indexed _token, address indexed _priceFeed);    

    constructor(bool addBasePriceFeeds, address _owner){
        if(addBasePriceFeeds)
            addBasePriceFeed();
        
        owner = _owner;
    } 
    
    function addBasePriceFeed() internal{
        addTokenToPriceFeed(ContractsListCL.AVAX_USD, ContractsListCL.CL_AVAX_USD);
        addTokenToPriceFeed(ContractsListCL.BTC_ETH, ContractsListCL.CL_BTC_ETH);
        addTokenToPriceFeed(ContractsListCL.BTC_USD, ContractsListCL.CL_BTC_USD);
        addTokenToPriceFeed(ContractsListCL.ETH_USD, ContractsListCL.CL_ETH_USD);
        addTokenToPriceFeed(ContractsListCL.LINK_ETH, ContractsListCL.CL_LINK_ETH);
        addTokenToPriceFeed(ContractsListCL.LINK_USD, ContractsListCL.CL_LINK_USD);
        addTokenToPriceFeed(ContractsListCL.USDT_USD, ContractsListCL.CL_USDT_USD);
    }    

    function addTokenToPriceFeed(address _token, address _priceFeed)
        public
        onlyOwner
    {
        require(
            _token != address(0) && _priceFeed != address(0),
            "Must be valid address"
        );
        tokenPriceFeedMapping[_token] = _priceFeed;
        emit priceFeedAdded(_token, _priceFeed);
    }


    function getAllInformationPriceFeed(address _token)
        public
        view
        validPriceFeed(_token)
        returns (
            uint80 roundID,
            int256 price,
            uint256 startedAt,
            uint256 timeStamp,
            uint80 answeredInRound
        )
    {        
        AggregatorV2V3Interface priceFeed = _getAggregatorV2V3Interface(_token);
        (
            uint80 roundID,
            int256 price,
            uint256 startedAt,
            uint256 timeStamp,
            uint80 answeredInRound
        ) = priceFeed.latestRoundData();
        require(timeStamp > 0, "Round has not finished");
        return (roundID, price, startedAt, timeStamp, answeredInRound);
    }

    function getHistoricalPrice(address _token, uint80 _roundId)
        public
        view
        validPriceFeed(_token)
        returns (int256 price)
    {
        AggregatorV2V3Interface priceFeed = _getAggregatorV2V3Interface(_token);
        (
            uint80 roundID,
            int256 price,
            uint256 startedAt,
            uint256 timeStamp,
            uint80 answeredInRound
        ) = priceFeed.getRoundData(_roundId);
        require(timeStamp > 0, "Round has not finished");
        return price;
    }

    function getOriginalOraclePrice(address _token)
        public
        view
        validPriceFeed(_token)
        contractPaused
        returns (int256 price)
    {
        AggregatorV2V3Interface priceFeed = _getAggregatorV2V3Interface(_token);
        (
            uint80 roundID,
            int256 price,
            uint256 startedAt,
            uint256 timeStamp,
            uint80 answeredInRound
        ) = priceFeed.latestRoundData();
        require(timeStamp > 0, "Round has not finished");
        return price;
    }

    /// @notice Returns Oracle Price for Token saved in <tokenPriceFeedMapping>
    /// @dev the token address have must be added before
    /// @param _token a parameter just like in doxygen (must be followed by parameter name)
    function getOraclePrice(address _token)
        public
        view
        validPriceFeed(_token)
        contractPaused
        returns (int256)
    {
        int256 price = _getConvertPrice(_token);
        uint8 decimals = getDecimalsOfPriceFeed(_token);
        require(
            _validDecimals(decimals) == true && decimals > 0,
            "invalid decimals"
        );
        int256 finalPrice = price * exp_base**(18 - decimals);
        require(finalPrice > 0, "Final price minus 0");
        return finalPrice;
    }

    function getDescriptionOfPriceFeed(address _token)
        public
        view
        validPriceFeed(_token)
        returns (string memory)
    {        
        AggregatorV2V3Interface priceFeed = _getAggregatorV2V3Interface(_token);
        return priceFeed.description();
    }

    function getDecimalsOfPriceFeed(address _token)
        public
        view
        validPriceFeed(_token)
        returns (uint8)
    {
        return _getAggregatorV2V3Interface(_token).decimals();
    }

    function getVersionOfPriceFeed(address _token)
        public
        view
        validPriceFeed(_token)
        returns (uint256)
    {
        return _getAggregatorV2V3Interface(_token).version();
    }

    function getLatestAnswer(address _token)
        public
        view
        validPriceFeed(_token)
        returns (int256)
    {
        return _getAggregatorV2V3Interface(_token).latestAnswer();
    }

    function pauseContract(bool _state) public onlyOwner returns (bool) {
        contract_paused = _state;
        return contract_paused;
    }

    function _getConvertPrice(address _token) internal view returns (int256) {
        int256 price = int256(getOriginalOraclePrice(_token));
        return price;
    }

    function _validDecimals(uint8 _decimals) internal pure returns (bool) {
        if (18 - _decimals <= 18) {
            return true;
        } else {
            return false;
        }
    }

    ///Interfaces helper for redundant Code
    function _getAggregatorV2V3Interface(address _token)
        private
        view
        returns (AggregatorV2V3Interface)
    {
        address priceFeedAddress = tokenPriceFeedMapping[_token];
        AggregatorV2V3Interface aggregator = AggregatorV2V3Interface(
            priceFeedAddress
        );
        return aggregator;
    }

    function getPriceFeedByToken(address _token)
        public
        view
        validPriceFeed(_token)
        returns (address)
    {        
        return tokenPriceFeedMapping[_token];
    }

    function _isValidPriceFeed(address _token) internal view returns (bool) {        
        if (tokenPriceFeedMapping[_token] != address(0)) {
            return true;
        } else {
            return false;
        }
    }

    function getOwner() public view returns(address){
        return owner;
    }
    //Modifiers
    modifier validPriceFeed(address _token) {
        require(_token != address(0), "No Address 0");
        require(_isValidPriceFeed(_token) == true, "Not valid token");
        _;
    }

    modifier contractPaused() {
        require(contract_paused == false, "Contract Paused");
        _;
    }

    modifier onlyOwner(){
        require(msg.sender == owner, "Only Owner");
        _;
    }
}

